import React, { useState } from "react";
import Nav from "./components/Nav";
import About from "./components/About";
import Portfolio from "./components/Portfolio";
import Contact from "./components/Contact";
import Gallery from "./components/Gallery";

function App() {
  const [categories] = useState([
    // { name: "About Me", description: "Feel free to learn more about me." },
     { name: "Technical Skills", description:"HTML 5, CSS, Bootstrap, Tailwind Javascript, Node.js, MySQL, MongoDB, Mongoose, Express.Js, React.js, & Git" },
    { name: "Education", description: "Full Stack Development | University of Utah | June 2022 --- Master of Education, Special Education | University of Utah | December 2020, Bachelor of Science, Psychology | University of Utah | May 2016 " },
  ]);

  const [currentCategory, setCurrentCategory] = useState(categories[0]);
  const [contactSelected, setContactSelected] =useState(false)
  return (
    <div class="flex">
      <Nav
        categories={categories}
        setCurrentCategory={setCurrentCategory}
        currentCategory={currentCategory}
        contactSelected={contactSelected}
        setContactSelected={setContactSelected}
      ></Nav>
      <main class="">

        {!contactSelected ? (
          <>
          <About></About>
          <Gallery currentCategory={currentCategory}></Gallery>
          <Portfolio></Portfolio>
          </>
        ) : (
          <Contact></Contact>
        )}
      </main>
    </div>
  );
}

export default App;
